import React, { Component } from 'react'
import { NavLink } from 'react-router-dom';
import Customers from "../MyStores/MyStores";
import Contact from "../ContactUs/ContactUs";
import About from "../About/About";
class Home extends Component {
    render() {
        return (
            <div id="wrapper">
            
                <div id="home" style={{ backgroundColor: "#282c34", height: "50vh", textAlign: "center" }}>
                    <div>LOGO</div>
                    <h3 style={{ color: "white", paddingTop: "4%" }}>YOUR CLUB CARD MANAGEMENT APPLICATION</h3>
                    <NavLink className="navLink" to="/users/login" style={{ marginRight: "3vw" }}>User login</NavLink>
                    <NavLink className="navLink" to="/enterprises/login">Enterprise login</NavLink>
                </div>
                <div id="about"><About></About> </div>
                <div id="stores"><Customers></Customers></div>
               <div id="contact"><Contact></Contact></div>
            </div>
        )
    }
}
export default Home;
